import React from "react";
import INTROVIDEO from "../../assets/img/intro-video.png";
import "./style.scss";

function Intro() {
  return (
    <div className="intro">
      <div className="intro-container">
        <img src={INTROVIDEO} alt="introvideo"></img>
      </div>
      <div className="intro-back">
        <div className="intro-back-white"></div>
        <div className="intro-back-black"></div>
      </div>
    </div>
  );
}

export default Intro;
